  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas).The
  EnviroAtlas Pittsburgh, PA land cover map was generated from United States Department
  of Agriculture (USDA) National Agricultural Imagery Program (NAIP) four band (red,
  green, blue, and near infrared) aerial photography at 1 m spatial resolution. Imagery
  was collected on multiple dates in June 2010. Five land cover classes were mapped:
  water, impervious surfaces, soil and barren land, trees and forest, and grass and
  herbaceous non-woody vegetation. An accuracy assessment of 500 completely random
  and 81 stratified random points yielded an overall accuracy of 86.57 percent. The
  area mapped is defined by the US Census Bureau's 2010 Urban Statistical Area for
  Pittsburgh, PA. This dataset was produced by the US EPA to support research and
  online mapping activities related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas)
  allows the user to interact with a web-based, easy-to-use, mapping application to
  view and analyze multiple ecosystem services for the contiguous United States. The
  dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
  or as an EnviroAtlas map service. Additional descriptive information about each
  attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
  (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
